import "./App.css";

function App() {
  return (
    <div className="App">
      <h1>Welcome to Planterest!</h1>
      <h3>
        An image board site for plant-lovers to curate boards with images of
        their favorite flora
      </h3>
      <h4>Come on in, the air is fresh in here!</h4>
    </div>
  );
}

export default App;
